const Footer: React.FC = () => {
    return <Row style={{display: 'flex', justifyContent: 'center', alignItems: 'center', paddingTop: '50px', paddingBottom: '60px'}}>
        <hr/>
        <div className='footer'>
            Copyright 2023
        </div>
    </Row>
}

export default Footer
